SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "public"."regional_names" (gid serial PRIMARY KEY,
"id" int4,
"awmc_id" int4,
"title" varchar(254),
"descriptio" varchar(254),
"type" varchar(50),
"maxdate" int4,
"mindate" int4,
"pid" varchar(50),
"awmc_mod" int4,
"creator" varchar(50),
"created" date,
"notes" varchar(254),
"awmc_class" int4);
SELECT AddGeometryColumn('public','regional_names','the_geom','4326','MULTILINESTRING',2);
CREATE INDEX "regional_names_the_geom_gist" ON "public"."regional_names" using gist ("the_geom");
COMMIT;
